println(s"""%html
    <link rel="stylesheet" href="assets/leaflet/leaflet.css" />
    <link rel="stylesheet" href="assets/leaflet/MarkerCluster.css" />
    <link rel="stylesheet" href="assets/leaflet/MarkerCluster.Default.css" />

    <script src="assets/leaflet/leaflet-src.js"></script>
    <script src="assets/leaflet/leaflet.markercluster-src.js"></script>

    <div id="map" style="position: relative; width: 600px; height: 600px; margin-left: auto; margin-right: auto;"></div>

    <script>
    var lat = 46.6, lng = 2.77;
    var map = L.map('map').setView([lat, lng], 6);
    //L.tileLayer('http://{s}.tile.osm.org/{z}/{x}/{y}.png', {
    //    attribution: 'Données de la carte &copy; <a href="http://www.openstreetmap.org/#map=5/51.500/-0.100">Open Street Map</a>',
    //    maxZoom: 18
    //}).addTo(map);

    L.tileLayer('http://{s}.tile.thunderforest.com/transport-dark/{z}/{x}/{y}.png', {
	    attribution: '&copy; <a href="http://www.thunderforest.com/">Thunderforest</a>, &copy; <a href="http://www.openstreetmap.org/copyright">OpenStreetMap</a>',
	    maxZoom: 19
    }).addTo(map);

    var markers = L.markerClusterGroup();
    ${jsonBornes}.forEach(borne => {
        markers.addLayer(L.marker([borne.latitude, borne.longitude], {title: borne.adresse})
            .bindPopup("<strong>" + borne.adresse + "</strong><br>" + "Type connecteur: " + borne.connecteur + "<br>Observations: " + borne.observations)) })
    map.addLayer(markers)
    </script>""")
